import React from "react";
import { Link } from "react-router-dom";

const About = () => {
  return (
    <div>
      <label>
        Title:
        <input />
      </label>
      <label>
        Cate:
        <input />
      </label>

      <Link to="/contact">
        <h3>About</h3>
      </Link>
    </div>
  );
};

export default About;
